import React from "react";


const ListItem = (props) => {
  return (
    <li>
      <div>
        <img src={props.image} alt='company logo'></img>
        <div>
          <p>{props.company}</p>
          {props.new? <button></button>: ''}
          <button>{props.new}</button>
          <button>{props.featured}</button>
          <br></br>
          <p>{props.position}</p>
          <br></br>
          <p>{props.postedAt} {props.contract} {props.location}</p>
        </div>
      </div>

      <div>
        {props.languages.map(item => 
        <button>
          {item}
        </button>)}
      </div>

    </li>
  )
}

export default ListItem;
